// Dashboard.js
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { MoreVertical, Trash2, FileText, Upload, Printer } from "lucide-react";
import { Apple, BookOpen, Library } from "lucide-react";

function Dashboard() {
  const navigate = useNavigate();
  const [recipes, setRecipes] = useState([]);
  const [menuOpenIndex, setMenuOpenIndex] = useState(null);

  useEffect(() => {
    const keys = Object.keys(localStorage);
    const validRecipes = [];

    keys.forEach((key) => {
      try {
        const val = JSON.parse(localStorage.getItem(key));
        if (val && typeof val.title === "string" && Array.isArray(val.ingredients)) {
          validRecipes.push({ key, title: val.title });
        }
      } catch (err) {
        console.warn(`⚠️ Could not parse ${key}`, err);
      }
    });

    setRecipes(validRecipes);
  }, []);

  const handleDelete = (key) => {
    if (window.confirm(`Delete this recipe?`)) {
      localStorage.removeItem(key);
      setRecipes(recipes.filter((r) => r.key !== key));
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 text-gray-900 font-dm-sans">
      {/* Header Bar */}
      <header className="bg-[#14523F] text-white px-6 py-2 shadow">
        <div className="flex flex-col items-start sm:flex-row sm:items-center sm:justify-between">
          <div className="flex items-start gap-3">
            <img src="/ToqueWorks.png" alt="Toque Logo" className="h-28 w-auto object-contain" />
          </div>

          {/* Tabs Navigation */}
          <nav className="flex gap-6 mt-4 sm:mt-0">
            <button onClick={() => navigate("/")} className="text-base font-medium text-white border-b-2 border-white pb-1 flex items-center gap-2"><FileText size={20} /> Recipes
            </button>
            <button onClick={() => navigate("/ingredients")} className="text-base font-medium text-white hover:text-gray-200 flex items-center gap-2"><Apple size={20} /> Ingredients
            </button>
            <button onClick={() => navigate("/menus")} className="text-base font-medium text-white hover:text-gray-200 flex items-center gap-2"><BookOpen size={20} /> Menus
            </button>
            <button onClick={() => navigate("/books")} className="text-base font-medium text-white hover:text-gray-200 flex items-center gap-2"><Library size={20} /> Recipe Books
            </button>
          </nav>
        </div>
      </header>

      <main className="p-6 space-y-6">
        <div className="text-xl font-semibold">Recipes</div>

        <div className="space-y-2">
          {recipes.map((recipe, index) => (
            <div
              key={recipe.key}
              className="flex items-center justify-between bg-white px-4 py-3 rounded shadow hover:shadow-md transition"
            >
              <button
                className="text-left font-medium hover:underline"
                onClick={() => navigate(`/recipe?title=${encodeURIComponent(recipe.title)}`)}
              >
                {recipe.title}
              </button>

              <div className="relative">
                <button
                  onClick={() =>
                    setMenuOpenIndex(index === menuOpenIndex ? null : index)
                  }
                  className="p-2 hover:bg-gray-200 rounded-full"
                >
                  <MoreVertical size={20} />
                </button>

                {menuOpenIndex === index && (
                  <div className="absolute right-0 mt-2 w-52 bg-white shadow-lg rounded-md border z-10">
                    <ul className="text-sm text-gray-700">
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <FileText size={16} /> Add to Recipe Book
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Upload size={16} /> Send a copy
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <FileText size={16} /> Make a copy
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Upload size={16} /> Export
                      </li>
                      <li className="px-4 py-2 hover:bg-gray-100 cursor-pointer flex items-center gap-2">
                        <Printer size={16} /> Print
                      </li>
                      <li
                        onClick={() => handleDelete(recipe.key)}
                        className="px-4 py-2 hover:bg-red-100 cursor-pointer text-red-600 flex items-center gap-2"
                      >
                        <Trash2 size={16} /> Delete
                      </li>
                    </ul>
                  </div>
                )}
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
